import React from "react";
import { Spring } from "react-spring/renderprops";
import { HeroContainer, LeftArrow, RightArrow } from "./HeroElements";
import Slide from "../Slide";
import arrLeft from "../../assets/images/arrw-l.png";
import arrRight from "../../assets/images/arrw-r.png";
import cosmog from "../../assets/images/cosmog.png";
const Hero = () => {
  return (
    <HeroContainer>
      <Spring from={{ opacity: 0 }} to={{ opacity: 1 }}>
        {(props) => (
          <div style={props}>
            <Slide
              img={cosmog}
              number="#789"
              name="Cosmog"
              kanji="コスモッグ"
            />
          </div>
        )}
      </Spring>
      <Spring from={{ opacity: 0 }} to={{ opacity: 1 }}>
        {(props) => (
          <div style={props}>
            <Slide
              img={cosmog}
              number="#789"
              name="Cosmog"
              kanji="コスモッグ"
            />
          </div>
        )}
      </Spring>
      <LeftArrow arrow={arrLeft} />
      <RightArrow arrow={arrRight} />
    </HeroContainer>
  );
};

export default Hero;
